const Home = () => {
  const handleClick = () => {
    console.log("Hello guys!");
  };

  const handleClickAgain = (name) => {
    console.log("Hello " + name, e.target);
  };

  return (
    <div className="home">
      <h2>Homepage</h2>
      <button onClick={handleClick} className="home-button">
        Click me
      </button>
      <button
        onClick={(e) => {
          handleClickAgain("gigi", e);
        }}
      >
        Click me again
      </button>
    </div>
  );
};

export default Home;
